import * as React from 'react';
import { Overview } from '../components/Overview';

import data from '../data/data';
import Sex from '../components/Sex';

const Dashboard: React.FunctionComponent = () => {
  console.log(data);

  const numberOfMales = data.filter((a) => a.sex === 'Male').length;
  const numberOfFemales = data.filter((a) => a.sex === 'Female').length;

  const sexStats = [numberOfMales, numberOfFemales];
  return (
    <>
      <Overview />
      <Sex stats={sexStats} />;
    </>
  );
};

export default Dashboard;
